import React from "react";
import "./table.css";

const Genericpage = ({
    pageName,
    tableHeaderComponent,
    tableInfoComponent,
    // createButtonComponent,
}) => {
    return (
        <section>
            <h2>{pageName}</h2>
            <table className="dataTable">
                <thead>
                    <tr className="tableHeader">
                        {tableHeaderComponent}
                        <th className="headerCell">Edit</th>
                        <th className="headerCell">Delete</th>
                    </tr>
                </thead>
                <tbody className="infoTable">{tableInfoComponent}</tbody>
                {/*
                 */}
            </table>
            {/* <div>{createButtonComponent}</div> */}
        </section>
    );
};

export default Genericpage;
